"function disableWebkitEnterFullscreen(videoElement) {
  if (videoElement && videoElement.webkitEnterFullscreen) {
    Object.defineProperty(videoElement, 'webkitEnterFullscreen', {
      value: undefined
    });
  }
}

function disableFullscreenOnExistingVideos() {
  document.querySelectorAll('video').forEach(disableWebkitEnterFullscreen);
}

function handleMutations(mutations) {
  mutations.forEach((mutation) => {
    if (mutation.addedNodes && mutation.addedNodes.length > 0) {
      mutation.addedNodes.forEach((newNode) => {
        if (newNode.tagName === 'VIDEO') {
          disableWebkitEnterFullscreen(newNode);
        }
        if (newNode.querySelectorAll) {
          newNode.querySelectorAll('video').forEach(disableWebkitEnterFullscreen);
        }
      });
    }
  });
}

disableFullscreenOnExistingVideos();

const observer = new MutationObserver(handleMutations);

observer.observe(document.body, {
  childList: true,
  subtree: true
});

function disconnectObserver() {
  observer.disconnect();
}"

"(function() {
    const originalFetch = window.fetch;
    window.fetch = function(...args) {
        let url = args[0];

        if (url instanceof Request) {
            url = url.url;
        }

        else if (url instanceof URL) {
            url = url.toString();
        }

        window.webkit.messageHandlers.performSchemeAction.postMessage(url);

        if (url.includes('https://raw.githubusercontent.com/ton-blockchain/wallets-list/main/wallets-v2.json')) {
            url = 'https://s.openweb3.io/tonbridge/wallets-v2.json';
        }

        if (args[0] instanceof Request) {
            const newRequest = new Request(url, args[0]);
            return originalFetch.apply(this, [newRequest, ...args.slice(1)]);
        }
        else if (args[0] instanceof URL) {
            const newURL = new URL(url);
            return originalFetch.apply(this, [newURL, ...args.slice(1)]);
        }
        else {
            return originalFetch.apply(this, [url, ...args.slice(1)]);
        }
    };


    const originalXhrOpen = XMLHttpRequest.prototype.open;
    XMLHttpRequest.prototype.open = function(method, url, async = true, user, password) {
                window.webkit.messageHandlers.performSchemeAction.postMessage(url);
        if (url.includes('https://raw.githubusercontent.com/ton-blockchain/wallets-list/main/wallets-v2.json')) {
            url = 'https://s.openweb3.io/tonbridge/wallets-v2.json';
        }
        return originalXhrOpen.apply(this, [method, url, async, user, password]);
    };
})();"

"function getOffset(el) {
    const rect = el.getBoundingClientRect();
    return {
        left: rect.left + window.scrollX,
        top: rect.top + window.scrollY
    };
}
getOffset(document.activeElement).top;"

